import styles from './Topics.module.css'

function TopicsHeader() {
    return <h1 className={styles.topicsHeader}>My topics of interest</h1>;
}

function TopicsTableRow(props) {
    return (
        <tr>
            <td className={styles.tableDataTopic}>{props.topic}</td>
            <td className={styles.tableDataDescription}>{props.description}</td>
        </tr>
    );
}

function TopicsTable() {
    const rows = [
        {topic: 'Coputer Systems Architecture', description: 'System Architecuture referst to the structure of the internal components of a computer system'},
        {topic: 'Dynamic Systems', description: 'In mathematics, a dynamical system is a system in which a function describes the time dependence of a point in an abient space. Examples include ...'},
        {topic: 'Object Oriented Programming', description: 'Object-oriented programming is a computer programming model that organizes software design around data, or objects.'},
        {topic: 'Functional Programming', description: 'Functional programming is a programming paradigm in which we try to bind everything in pure mathematical functions style.'},
        {topic: 'Data Structures', description: 'Data structure is a storage that is used to store and organize data.'},
    ];
    
    return (
        <table className={styles.topicsTable}>
            <tr>
                <th className={styles.tableHead}>Topic</th>
                <th className={styles.tableHead}>Description</th>
            </tr>
            {rows.map((topic, index) => 
                <TopicsTableRow key={index} topic={topic.topic} description={topic.description} />
            )}             
        </table>
    );
}

function AddOptions() {
    return (
        <select className={styles.addSelect}>
            <option value="One">One</option>
            <option value="Two">Two</option>
            <option value="Three">Three</option>
            <option value="Four">Four</option>
            <option value="Five">Five</option>
        </select>
    );
}

function DeleteButton() {
    return (
        <button className={styles.deleteButton} type="button">Delete</button>
    );
}

function TableModifiers() {
    return (
        <div className={styles.tableModifiers}>
            <DeleteButton />
            <AddOptions />
        </div>
    );
}

function TopicsContent() {
    return (
        <div className={styles.topicsContent}>
            <TopicsTable />
            <TableModifiers />
        </div>
    );
}

function TopicsPage() {
    return (
        <div className={styles.topicsContainer}>
            <TopicsHeader />
            <div className={styles.separator}></div>
            <TopicsContent />
        </div>
    );
}


export { TopicsPage }
